<p>I am trying to rewrite my old function which make http-requests and insert many object at mongoDB via mongoose. I already have a working version of it, but I face a problem while using it. Basically, because when I'm trying to insertMany 20 arrays from 20+ request with ~50'000 elements from one request it cause a huge memory leak. Even with MongoDB optimization.</p>

<p>Logic of my code: </p>

<pre><code>function main() {
    server.find({locale: "en_GB"}).exec(function (err, server) {
        for (let i = 0; i &lt; server.length; i++) { //for example 20 servers
            rp({url: server[i].slug}).then(response =&gt; {
                auctions.count({
                    server: server[i].name,
                    lastModified: {$gte: response.data.files[0].lastModified}
                }).then(function (docs) {
                    if (docs &lt; 0) {
                      //We don't insert data if they are already up-to-date
                    }
                    else {
                        //I needed response.data.files[0].url and server[i].name from prev. block
                        //And here is my problem
                        requests &amp; insertMany and then =&gt; loop main()
                        })
                    }
                })
            }).catch(function (error) {
                console.log(error);
            })
        }
    })
}

main()
</code></pre>

<p>Actually I have already trying many different things to fix it. First-of-all I was trying to add setInterval after <code>else</code> block like this:</p>

<pre><code>setTimeout(function () {
