Mongoose model.update and model.findOneAndUpdate are not actually updating<p><code>model.update</code> and <code>model.findOneAndUpdate</code> do not actually perform updates even when they match documents.</p>

<p>I must be losing my mind, because a problem this large would surely be seen by others. (This is a dramatically simplified duplicate of a prior post I submitted after doing some more testing.)</p>

<p>I've been able to replicate this issue with multiple versions of Mongoose (4.0.7 and 5.3.2) and Node (v8 and v10), and in two completely different environments (Ubuntu 16.04 and Windows 10) with a tiny Node.js file:</p>

<pre><code>const mongoose = require('mongoose');
mongoose.set('debug',true);
mongoose.connect('mongodb://localhost/db',{useNewUrlParser: true});
console.log(mongoose.version);
const model = mongoose.model(
  'tests',
  new mongoose.Schema({hello:String})
);
const test = new model({hello:'world'});
test.save(()=&gt;{
  model.count({},(err,count)=&gt;{
    console.log(count);
    model.findOneAndUpdate({},{dummy:true},{new:true},(updateErr,doc)=&gt;{
      console.log(doc);
    });
  });
});
</code></pre>

<p>The result of running this is:</p>

<pre><code>5.3.2
Mongoose: tests.insert({ hello: 'world', _id: ObjectId("5bbea605cb4a882433725bfe"), __v: 0 })
Mongoose: tests.count({}) {}
6
Mongoose: tests.findOne({ dummy: { '$ne': true } }) { new: true, fields: undefined }
{ _id: 5bbe9f7c5362642220dde2d7, hello: 'world', __v: 0 }
</code></pre>

<p>Whether I use <code>update</code> or <code>findOneAndUpdate</code> no updates actually occur, and that's true even if my search doc is the empty <code>{}</code>. The higher count is due to running this multiple times. I can run the update command directly in the mongo shell without trouble, and can confirm via the shell that nothing is getting updated.</p>

<p>Can anyone replicate this? Perhaps with fresh installs of Mongoose? Am I just being super duper dumb about something?</p>

