<pre><code>db.users.find({"field1": "value1"}, {"field1" : 1,"field2": {$in: ["item1", "item3","item5"]}}).pretty()
</code></pre>

<p>Thanks a lot!</p>

<p>Solved:
Thanks to Anthony Winzlet, all that was missing is that it has to match field 1 like:</p>

<pre><code>db.collection.aggregate([
  {
    $match: {"field1": "value1"}
  },
  { "$project": {
    "field2": {
      "$filter": {
        "input": "$field2",
        "cond": {
          "$in": [
            "$$this",
            ["item1", "item3", "item5"]
          ]
        }
      }
    }
  }}
])
</code></pre>

