Node.js Testing with Mongoose. unique gets ignored<p>I'm having a little trouble with an integration test for my mongoose application. The problem is, that my unique setting gets constantly ignored. The Schema looks more or less like this (so no fancy stuff in there)</p>

<pre><code>const RealmSchema:Schema = new mongoose.Schema({
    Title : {
        type : String,
        required : true,
        unique : true
    },    
    SchemaVersion : {
        type : String,
        default : SchemaVersion,
        enum: [ SchemaVersion ]
    }
}, {
    timestamps : {
        createdAt : "Created",
        updatedAt : "Updated"
    }
});
</code></pre>

<p>It looks like basically all the rules set in the schema are beeing ignored. I can pass in a Number/Boolean where string was required. The only thing that is working is fields that have not been declared in the schema won't be saved to the db</p>

<p><strong>First probable cause:</strong></p>

<p>I have the feeling, that it might have to do with the way I test. I have multiple integration tests. After each one my database gets dropped (so I have the same condition for every test and precondition the database in that test).</p>

<p>Is is possible that the reason is my indices beeing droped with the database and not beeing reinitiated when the next text creates database and collection again? And if this is the case, how could I make sure that after every test I get an empty database that still respects all my schema settings?</p>

<p><strong>Second probable cause:</strong></p>

<p>I'm using TypeScript in this project. Maybe there is something wrong in defining the Schema and the Model. This is what i do.</p>

<p><em>1. Create the Schema (code from above)</em></p>

<p><em>2. Create an Interface for the model (where IRealmM extends the Interface for the use in mongoose)</em></p>

<pre><code>import { SpecificAttributeSelect } from "../classes/class.specificAttribute.Select";
import { SpecificAttributeText } from "../classes/class.specificAttribute.Text";
import { Document } from "mongoose";

interface IRealm{
    Title : String;
    Attributes : (SpecificAttributeSelect | SpecificAttributeText)[];
}

interface IRealmM extends IRealm, Document {

}

export { IRealm, IRealmM }
</code></pre>

<p><em>3. Create the model</em></p>

<pre><code>import { RealmSchema } from '../schemas/schema.Realm';
import { Model } from 'mongoose';
import { IRealmM } from '../interfaces/interface.realm';


// Apply Authentication Plugin and create Model
const RealmModel:Model&lt;IRealmM&gt; = mongoose.model('realm', RealmSchema);

// Export the Model
export { RealmModel }
</code></pre>

